usch<br />\nSalado Wine Seller<br />\n(254) 947-8011<br />\nwww.saladowine.com<br /><br />\nFor other events that might interest you this weekend, check www.salado.com:<br />\nFriday, October 10<br />\n9 am â€“ 8 pm, Christmas in October, free admission<br />\nStart your holiday shopping now and visit the Giant Ladiesâ€™ Auxiliary Bake Sale <br /><br />\nSaturday, October 11<br />\n9 am â€“ 5 pm, Christmas in October, free admission<br />\n5 pm â€“ 9 pm, Fine Art Gallery Tour, free admission<br />\nVisit the Salado art galleries, view chocolate sculptures and visit with Susan Eminger &amp; sample her famous cheesecake-stuffed strawberries dipped in chocolate<br /><br />\nSunday, October 12<br />\n11 am -2 pm Chocolate &amp; Art Brunch<br />\nPurchase your tickets at www.saladochocolatefestival.com/tickets.htm for brunch at Adeleaâ€™s, Stagecoach Inn, or Inn on the Creek.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1175558/</guid>\n    <link>http://upcoming.yahoo.com/event/1175558/</link>\n    <comments>http://upcoming.yahoo.com/event/1175558/#comments</comments>\n    <geo:lat>30.9548</geo:lat>\n    <geo:long>-97.5341</geo:long>\n    <pubDate>Sat, 04 Oct 2008 21:41:58 -0700</pubDate>\n    <dc:date>2008-10-04T21:41:58-07:00</dc:date>\n    <xCal:summary>Wine and Chocolate at Salado Wine Seller</xCal:summary>\n    <xCal:dtstart>2008-10-10T19:30:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/144863/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/144863/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Salado Wine Seller</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>881-B N. Main St.</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Salado</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>76571