Organizing Party at Precinct Chair&#39;s House</title>\n    <description><![CDATA[Come join us for a precinct get-together on Saturday, October 11, to learn about what we can do to help our local Democrats. Maybe you&#39;d like to make phone calls, or knock on doors, or be a Block Captain and help get out the vote on Election Day! Maybe you&#39;d even like to travel to Colorado and help swing that state for Barack Obama! Opportunities to volunteer abound. Our candidates can&#39;t do it without us, and every little bit helps!<br /><br />\n<hr><br />\n<a rel="nofollow" HREF="http://my.barackobama.com/page/event/detail/gsh44d">This event</a> was submitted by <a rel="nofollow" HREF="http://my.barackobama.com/">MyBO</a>.  Be sure to <b><a rel="nofollow" HREF="http://my.barackobama.com/page/event/detail/gsh44d#rsvp">RSVP for this event @ MyBO</a>!</b><br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1175341/</guid>\n    <link>http://upcoming.yahoo.com/event/1175341/</link>\n    <comments>http://upcoming.yahoo.com/event/1175341/#comments</comments>\n    <geo:lat>30.3003</geo:lat>\n    <geo:long>-97.7326</geo:long>\n    <pubDate>Sat, 04 Oct 2008 20:19:59 -0700</pubDate>\n    <dc:date>2008-10-04T20:19:59-07:00</dc:date>\n    <xCal:summary>Precinct 275 Organizing Party</xCal:summary>\n    <xCal:dtstart>2008-10-11T16:00:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/250331/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/250331/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Precinct Chair&#39;s House</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>3802 Avenue F,</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78705</xCal:x-calconnect-postalcode>\