o.com/venue/126399/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Oct 10, 2008: Amadeus at Austin Playhouse at Penn Field</title>\n    <description><![CDATA[This is a drama by Peter Schaffer about God&#39;s capricious bestowal of talent. Salieri is intelligent, educated, industrious and talented. Mozart is crude, puerile, scattered, unreliable and a genius. And poor Salieri is the only one talented enough to know the difference. It haunts him. Salieri narrates as an extended confession of his raging envy. He does all he can to doom Mozart&#39;s career and promote his own, and he succeeds at that while withering his own soul. But did he poison Mozart?<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1174328/</guid>\n    <link>http://upcoming.yahoo.com/event/1174328/</link>\n    <comments>http://upcoming.yahoo.com/event/1174328/#comments</comments>\n    <geo:lat>30.2279</geo:lat>\n    <geo:long>-97.7612</geo:long>\n    <pubDate>Sat, 04 Oct 2008 07:41:56 -0700</pubDate>\n    <dc:date>2008-10-04T07:41:56-07:00</dc:date>\n    <xCal:summary>Amadeus</xCal:summary>\n    <xCal:dtstart>2008-10-10T20:00:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/151276/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/151276/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Austin Playhouse at Penn Field</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>3601 S Congress, Bldg. C</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>TX</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78763</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue 