al pleasure, all American hot dogs and hamburgers, and that&#39;s not to mention the deeeelicious home-made desserts. We&#39;ll cap the whole event with a fan-tabulous Silent Auction, the likes of which you may never see again. Check for more info:<br /><br />\nwww.bastropcountydemocraticparty.com.<br /><br />\nSee you there.<br />\nBCDP<br /><br />\n<hr><br />\n<a rel="nofollow" HREF="http://my.barackobama.com/page/event/detail/gshwjh">This event</a> was submitted by <a rel="nofollow" HREF="http://my.barackobama.com/">MyBO</a>.  Be sure to <b><a rel="nofollow" HREF="http://my.barackobama.com/page/event/detail/gshwjh#rsvp">RSVP for this event @ MyBO</a>!</b><br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1173422/</guid>\n    <link>http://upcoming.yahoo.com/event/1173422/</link>\n    <comments>http://upcoming.yahoo.com/event/1173422/#comments</comments>\n    <geo:lat>30.1126</geo:lat>\n    <geo:long>-97.3223</geo:long>\n    <pubDate>Sat, 04 Oct 2008 04:37:41 -0700</pubDate>\n    <dc:date>2008-10-04T04:37:41-07:00</dc:date>\n    <xCal:summary>Democratic Super Rally</xCal:summary>\n    <xCal:dtstart>2008-10-18T17:00:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/248948/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/248948/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Bastrop Fisherman&#39;s Park</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>Farm and Wilson Streets,</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Bastrop</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78602</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/248948/</xCal:url>\n