0pm with the meeting to follow at 7pm. Feel free to arrive late if you need to. Please contact Clint at <a rel="nofollow" href="mailto:clintcarrens@gmail.com">clintcarrens@gmail.com</a> to RSVP.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1170296/</guid>\n    <link>http://upcoming.yahoo.com/event/1170296/</link>\n    <comments>http://upcoming.yahoo.com/event/1170296/#comments</comments>\n    <geo:lat>30.2724</geo:lat>\n    <geo:long>-97.7348</geo:long>\n    <pubDate>Fri, 03 Oct 2008 20:01:44 -0700</pubDate>\n    <dc:date>2008-10-03T20:01:44-07:00</dc:date>\n    <xCal:summary>Austin Kiwanis Young Professionals Group Meeting</xCal:summary>\n    <xCal:dtstart>2008-11-05T18:30:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/218213/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/218213/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Brick Oven Restaurant</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>1209 Red River</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78701</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/218213/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Nov  5, 2008: Austin Kiwanis Young Professionals Group Meeting at Brick Oven Restaurant</title>\n    <description><![CDATA[Austin Kiwanis Young Professionals is a brand new group for working men and women in their 20s and 30s. It is designed for young adults who want to give back to their community but have limited time due to hectic lives and work schedules. Its activities are tailored toward young professionals&#39; preferences and expectations, providing hands-on volunteering opportunities, happy-hour-style socials, and career networking and development. And it provides a great opportunity to join a wonderful worldwide organization dedicated to serving children and communities.<br /><br />\nDinner starts at 6:30pm with the meeting to follow at 7pm. Feel free to arrive late if you need to. Please contact Clint at <a rel="nofollow" href="mailto:clintcarrens@gmail.com">clintcarrens@gmail.com</a> to RSVP.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1170295/</guid>\n    <link>http://upcoming.yahoo.com/event/1170295/</link>\n    <comments>http://upcoming.yahoo.com/event/1170295/#comments</comments>\n    <geo:lat>30.2724</geo:lat>\n    <geo:long>-97.7348</geo:long>\n    <pubDate>Fri, 03 Oct 2008 20:01:24 -0700</pubDate>\n    <dc:date>2008-10-03T20:01:24-07:00</dc:date>\n    <xCal:summary>Austin Kiwanis Young Professionals Group Meeting</xCal:summary>\n    <xCal:dtstart>2008-11-05T18:30:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/218213/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/218213/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Brick Oven Restaurant</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>1209 Red River</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78701</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/218213/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Nov 12, 2008: American Women in Radio and TV Engage Kimberlie Dykeman for Austin Luncheon at Austin Women&#39;s Club</title>\n    <description><![CDATA[Coordinators of the AWRT Austin Chapter &quot;Assisting Success&quot; Luncheon called upon Kimberlie Dykeman to be the event speaker.  To promote the growing event, AWRT&#39;s Austin directors will tap multimedia and the internet&#39;s reach with video and audio promo spots hosted by Dykeman for media outlets and interactive press releases. Dykeman&#39;s speaking presentation includes interactive conversation around her newly launched platform â€œSOAPBOXÂ® for the 9-to-5erâ€, based on her newly published book PURE SOAPBOX. <br /><br />\nAbout: The mission of AWRT is to advance the impact of women in the electronic media and allied fields by educating, advocating and acting as a resource to our members and the industry.   www.awrt.org<br /><br />\nAbout â€œSOAPBOXÂ® for the 9-to-5erâ€<br />\nThis is for anyone whoâ€™s ever had a Murphyâ€™s Law kind of day â€¦or month, for that matter! Anyone just starting a job, raising a kid on your own, newly divorced, new to the city, trying to quit smoking or lose those 20 poundsâ€¦again, hitting the mid-life mark, upside-down in their home. From weekend-entrepreneurs to wet-behind-the-ears college grads, single parents to soon-to-be retirees, 9-to-5ers are all on the same playing field. All facing the stress of cultural, economic and personal issues, while trying to make a living and a life! Luckily, thereâ€™s a SOAPBOXÂ® with your name on itâ€¦to help you face your challenges, change your perspective, embrace the kid in you, take the road less traveled, and seize the day! Paired with Kimberlieâ€™s unique A.N.S.W.E.Râ„¢ formula, youâ€™ll see how to create a realistic AND optimistic path Work Smarter, Feel Stronger, Look Better, Live Longer. No candy coating. No band-aid therapy. Motivation with a swift kick in the pants.<br /><br />\nwww.puresoapbox.com<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1170265/</guid>\n    <link>http://upcoming.yahoo.com/event/1170265/</link>\n    <comments>http://upcoming.yahoo.com/event/1170265/#comments</comments>\n    <geo:lat>30.2705</geo:lat>\n    <geo:long>-97.747</geo:long>\n    <pubDate>Fri, 03 Oct 2008 19:40:28 -0700</pubDate>\n    <dc:date>2008-10-03T19:40:28-07:00</dc:date>\n    <xCal:summary>American Women in Radio and TV Engage Kimberlie Dykeman for Austin Luncheon</xCal:summary>\n    <xCal:dtstart>2008-11-12T11:30:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/244498/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/244498/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Austin Women&#39;s Club</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>708 San Antonio</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode></xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/244498/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Oct  5, 2008: Heybale at Continental Club</title>\n    <description><![CDATA[Haybale is a country cover band featuring Redd Volkaert on guitar and Earl Poole Ball on keys.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1170048/</guid>\n    <link>http://upcoming.yahoo.com/event/1170048/</link>\n    <comments>http://upcoming.yahoo.com/event/1170048/#comments</comments>\n    <geo:lat>30.2506</geo:lat>\n    <geo:long>-97.7491</geo:long>\n    <pubDate>Fri, 03 Oct 2008 18:27:22 -07