calconnect-venue-name>\n      <xCal:x-calconnect-street>1315 S Congress Ave</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78704</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/44543/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Nov  5, 2008: AMP Networking Event - Austin 1st Wed Every Month at Sherlock&#39;s Pub - Austin</title>\n    <description><![CDATA[Real Estate Industry Networking Event for Realtors, Lenders, Builders &amp; Vendors.<br /><br />\nAMP Networking promotes &amp; provides FUN events, education and travel opportunity to deepen business and social relationships, improve networking, and further career opportunities for mortgage industry professionals. Our member invitation list is over 10,000, and 900 people attend our Mortgage Industry Networking events every month in Dallas, Plano, Tarrant County, Houston &amp; Austin.<br /><br />\nBring your BUSINESS CARDS for ENTRY!<br /><br />\nShare food, drinks &amp; networking with friends in the Real Estate &amp; Mortgage business<br /><br />\nRetail Loan Officers<br />\nRealtors<br />\nBuilders<br />\nMortgage Brokers<br />\nLoan Processors<br />\nWholesale Lenders<br />\nCredit Reporting<br />\nDoc Prep Attorneys<br />\nTitle Companies<br />\nPMI Companies<br />\nAppraisers<br />\nSurveyors<br />\nInsurance Agents<br />\nFinancial Consultants<br />\nPlacement Firms<br />\nDown Payment Grant Reps<br />\nCredit Repair Reps<br />\nother Vendors<br /><br />\nCome see your old friends and make new ones!<br />\nDelicious Appetizers and Happy Hour Drink Specials<br />\nare provided by your Strategic Partners<br /><br />\nJoin us for a FAMOUS good time<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1169478/</guid>\n    <link>http://upcoming.yahoo.com/event/1169478/</link>\n    <comments>http://upcoming.yahoo.com/event/1169478/#comments</comments>\n    <geo:lat>30.3726</geo:lat>\n    <geo:long>-97.7259</geo:long>\n    <pubDate>Fri, 03 Oct 2008 14:05:42 -0700</pubDate>\n    <dc:date>2008-10-03T14:05:42-07:00</dc:date>\n    <xCal:summary>AMP Networking Event - Austin 1st Wed Every Month</xCal:summary>\n    <xCal:dtstart>2008-11-05T17:30:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/103264/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/103264/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Sherlock&#39;s Pub - Austin</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>9012 Research Boulevard</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode></xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/103264/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Oct 16, 2008: Bootstrap Vote Town Hall Meeting at Conjunctured Bldg,</title>\n    <description><![CDATA[Presidents, policy, and entrepreneurs: how will the November election affect small business?<br /><br />\nThursday, October 16, 7pm-9pm at Conjunctured, 1309 E. 7th St.<br /><br />\nBootstrap Austin&#39;s Vote Subgroup:<br />\nJoin here: <a rel="nofollow" href="http://groups.google.com/group/bootstrap-vote">http://groups.google.com/group/bootstrap-vote</a><br />\nInformation here: <a rel="nofollow" href="http://www.bootstrapaustin.org/wiki/index.php/Vote_Subgroup">http://www.bootstrapaustin.org/wiki/index.php/Vote_Subgroup</a><br /><br />\nAbout the Bootstrap Network: <a rel="nofollow" href="http://www.bootstrapaustin.org/wiki/index.php/Main_Page">http://www.bootstrapaustin.org/wiki/index.php/Main_Page</a><br /><br />\n&quot;Food for thought&quot;:<br /><br />\nObama/Biden plan for small business: <a rel="nofollow" href="http://budurl.com/7um8">http://budurl.com/7um8</a> (pdf)<br />\nJohn McCain&#39;s plan for small business: <a rel="nofollow" href="http://budurl.com/j7jr">http://budurl.com/j7jr</a><br />\nBob Barr and the Entrepreneur Vote: <a rel="nofollow" href="http://budurl.com/yjky">http://budurl.com/yjky</a><br />\nTen Key Values of the Green Party: <a rel="nofollow" href="http://www.gp.org/tenkey.shtml">http://www.gp.org/tenkey.shtml</a><br /><br />\n One area of possible focus: economic policy. Here&#39;s a recent reference:<br /><br />\nNYTimes: Small Businesses Feeling the Chill <a rel="nofollow" href="http://budurl.com/plfg">http://budurl.com/plfg</a><br /><br />\n&quot;Some small companies say they are no longer able to get loans from newly cautious banks as credit tightens across the country, and even those who do qualify are increasingly reluctant to borrow and expand, fearful of overextending themselves in the midst of the financial crisis.&quot;<br /><br />\nBootstrappers self-finance but often use small loans and personal credit, and our customers and clients may also depend on credit to buy our products or services. We need a healthy economy to survive. How do we feel about the issue of regulation vs deregulation? <br /><br />\n<a rel="nofollow" href="http://en.wikipedia.org/wiki/Regulation">http://en.wikipedia.org/wiki/Regulation</a> <a rel="nofollow" href="http://en.wikipedia.org/wiki/Deregulation">http://en.wikipedia.org/wiki/Deregulation</a><br /><br />\nHow do we respond to conversations around current economic conditions and the proposed &quot;bailout&quot;?  <br /><br />\n<a rel="nofollow" href="http://en.wikipedia.org/wiki/Proposed_bailout_of_United_States_financial_system">http://en.wikipedia.org/wiki/Proposed_bailout_of_United_States_financial_system</a><br /><br />\n Note about process: political conversations can be contentious. This will be a moderated conversation, and we&#39;re asking for a commitment to civility and respect. It&#39;s too rare that we see civil conversation among those who disagree; that&#39;s what we&#39;re looking for here. Come prepared to listen to views you may disagree with, and engage respectfully.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1169448/</guid>\n    <link>http://upcoming.yahoo.com/event/1169448/</link>\n    <comments>http://upcoming.yahoo.com/event/1169448/#comments</comments>\n    <geo:lat>30.2647</geo:lat>\n    <geo:long>-97.7287</geo:long>\n    <pubDate>Fri, 03 Oct 2008 13:24:21 -0700</pubDate>\n    <dc:date>2008-10-03T13:24:21-07:00</dc:date>\n    <xCal:summary>Bootstrap Vote Town Hall Meeting</xCal:summary>\n    <xCal:dtstart>2008-10-16T19:00:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/177109/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/177109/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Conjunctured Bldg,</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>1309 E. 7th Street</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78702</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/177109/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calcon