ly frame, while contributing backup vocals that belie it.<br />\n]]></description>\n    <guid>http://upcoming.yahoo.com/event/1251451/</guid>\n    <link>http://upcoming.yahoo.com/event/1251451/</link>\n    <comments>http://upcoming.yahoo.com/event/1251451/#comments</comments>\n    <geo:lat>30.2695</geo:lat>\n    <geo:long>-97.7363</geo:long>\n    <pubDate>Sun, 19 Oct 2008 20:15:05 -0700</pubDate>\n    <dc:date>2008-10-19T20:15:05-07:00</dc:date>\n    <xCal:summary>Moonlight Towers</xCal:summary>\n    <xCal:dtstart>2008-11-14T21:00:00Z</xCal:dtstart>\n    <xCal:dtend></xCal:dtend>\n    <xCal:location>http://upcoming.yahoo.com/venue/1785/</xCal:location>\n    <xCal:x-calconnect-venue>\n     <xCal:x-calconnect-venue-id>http://upcoming.yahoo.com/venue/1785/</xCal:x-calconnect-venue-id>\n     <xCal:adr>\n      <xCal:x-calconnect-venue-name>Club DeVille</xCal:x-calconnect-venue-name>\n      <xCal:x-calconnect-street>900 Red River St</xCal:x-calconnect-street>\n      <xCal:x-calconnect-city>Austin</xCal:x-calconnect-city>\n      <xCal:x-calconnect-region>Texas</xCal:x-calconnect-region>\n      <xCal:x-calconnect-postalcode>78701</xCal:x-calconnect-postalcode>\n      <xCal:x-calconnect-country>United States</xCal:x-calconnect-country>\n     </xCal:adr>\n     <xCal:url type=''Venue Website''>http://upcoming.yahoo.com/venue/1785/</xCal:url>\n     <xCal:x-calconnect-tel></xCal:x-calconnect-tel>\n    </xCal:x-calconnect-venue>\n    </item>\n   <item>\n    <title>Oct 22, 2008: Flying Machine Theater Machine at The Hideout Coffeehouse &amp; Theater</title>\n    <description><![CDATA[]]></description>\n    <guid>http://upcoming.yahoo.com/event/1251405/</guid>\n    <link>http://upcoming.yahoo.com/event/1251405/</link>\n    <comments>http://upcoming.yahoo.com/event/1251405/#comments</comments>\n    <geo:lat>30.2683</geo:lat>\n    <geo:long>-97.7426</geo:long>\n    <pubDate>Sun, 19 Oct 2008 20:05:43 -0700</pubDate>\n    <dc:date>2008-10-19T20:05:43-07:00</dc:date>\n    <xCal:summary>